: An Oral History of the Zombie War ( ) is an apocalyptic horror novel by . The novel is set in a world where zombies have overrun the United States and are now in control of the country. It is based on the true story of the Battle of Gettysburg, which was fought in 1863 and involved the Confederate Army of Northern Virginia, commanded by General Robert E. Lee. The Zombie Apocalypse: A Biography of the Zombie ( 2009 ) by Robert F. Kennedy Jr. is a history of the zombie apocalypse.

